import React from "react"

const Notification = ({ message }) => {
    if (message === null) {
      return null
    }  

    if (message.includes("fail")){
      return <div className="fail">{message}</div>;
    }

    if (message.includes("success")){
      return <div className="success">{message}</div>;
    }
  }
